import { MDBIcon, MDBModal, MDBModalDialog, MDBModalContent, MDBModalBody, MDBTable, MDBTableHead, MDBTableBody } from 'mdb-react-ui-kit';
import React, { useEffect, useState } from 'react';
import gallery from '../../Assets/image4.jpg'
import axios from 'axios';
import './RequestReceived.css'
const RequestReceived = () => {
    const [request, setRequest] = useState([]);
    const [bottomModal, setBottomModal] = useState(false);
    const [bottomModal2, setBottomModal2] = useState(false);
    useEffect(() => {
        // Fetch request data using axios and update the state
        const fetchRequestData = async () => {
            try {
                const response = await axios.get('https://localhost:7026/AdminSide/GetAllRequest');
                console.log(response.data);
                setRequest(response.data); // Assuming the API response contains the data for requests
            } catch (error) {
                console.error(error);
            }
        };

        fetchRequestData();
    }, []);

    return (
        <div>
            <div>
                <img src={gallery} className='gallery-img' />
            </div>
            <div className='gallery-head'>IMAGE GALLERY</div>
            <div className="container">
                <MDBTable align='middle'>
                    <MDBTableHead className='back-color'>
                        <tr>
                            <th scope='col'>Name</th>
                            <th scope='col'>Agency Name</th>
                            <th scope='col'>Age</th>
                            <th scope='col'>Experience</th>
                            <th scope='col'>Email-Id</th>
                            <th scope='col'>Phone Number</th>
                            <th scope='col'>Decision</th>
                        </tr>
                    </MDBTableHead>
                    <MDBTableBody>
                        {request.map((item, index) => (
                            <tr key={index}>
                                <td className='table-data'>{item.name}</td>
                                <td className='table-data'>{item.agencyName}</td>
                                <td className='table-data'>{item.age}</td>
                                <td className='table-data'>{item.yearsOfExperience}</td>
                                <td className='table-data'>{item.email}</td>
                                <td className='table-data'>{item.phoneNumber}</td>
                                <td>
                                    <div className='flex-table'>
                                        <div onC><MDBIcon far icon="check-circle" className='move-right' color='success' size='2x' /></div>
                                        <div><MDBIcon far icon="times-circle" color='danger' size='2x' /></div>
                                    </div>
                                </td>
                            </tr>
                        ))}
                    </MDBTableBody>
                </MDBTable>
            </div>
            {/* Displaying the MDBModal when bottomModal is true */}
            <MDBModal className='position' animationDirection='bottom' show={bottomModal} tabIndex='-1' setShow={setBottomModal}>
                <MDBModalDialog position='bottom' frame>
                    <MDBModalContent className='success-modal'>
                        <MDBModalBody className='py-1'>
                            <div className='d-flex justify-content-center align-items-center my-3'>
                                <p className='mb-0'>Accepted Successfully &nbsp;<MDBIcon far icon="smile-beam" />!!</p>
                            </div>
                        </MDBModalBody>
                    </MDBModalContent>
                </MDBModalDialog>
            </MDBModal>

            {/* Displaying the MDBModal when bottomModal is true */}
            <MDBModal className='position' animationDirection='bottom' show={bottomModal2} tabIndex='-1' setShow={setBottomModal2}>
                <MDBModalDialog position='bottom' frame>
                    <MDBModalContent className='failure-modal'>
                        <MDBModalBody className='py-1'>
                            <div className='d-flex justify-content-center align-items-center my-3'>
                                <p className='mb-0'>Rejected Successfully &nbsp;<MDBIcon far icon="smile-beam" />!!</p>
                            </div>
                        </MDBModalBody>
                    </MDBModalContent>
                </MDBModalDialog>
            </MDBModal>
        </div>
    );
};

export default RequestReceived;
